---
apiVersion: app.k8s.io/v1beta1
kind: Application
metadata:
  name: $DEPLOYMENT_NAME
  namespace: spinnaker
  annotations:
    kubernetes-engine.cloud.google.com/icon: >-
      data:image/png;base64, 
    marketplace.cloud.google.com/deploy-info: '{"partner_id": "google-cloud-platform", "product_id": "spinnaker", "partner_name": "Google"}'
  labels:
    app.kubernetes.io/name: spinnaker
    app.kubernetes.io/instance: $DEPLOYMENT_NAME
    app.kubernetes.io/version: $SPINNAKER_VERSION
    app.kubernetes.io/managed-by: Marketplace
spec:
  descriptor:
    type: Spinnaker
    version: $SPINNAKER_VERSION
    description: |-
      Spinnaker is an open source, multi-cloud continuous
      delivery platform for releasing software changes with
      high velocity and confidence.

      If you would like to learn more about Spinnaker, please
      visit the [Spinnaker website](https://spinnaker.io/).

      # Support

      This image is built by Google. It is your responsibility to keep
      container images you run or store in your own repositories
      up to date with security patches.

      Community support for Spinnaker is available on:

      [GitHub](https://github.com/spinnaker/spinnaker/issues)

      [Slack](http://join.spinnaker.io/)

      [Stack Overflow](http://stackoverflow.com/questions/tagged/spinnaker/)
    maintainers:
    - name: Google Click to Deploy
      url: https://cloud.google.com/solutions/#click-to-deploy
    links:
    - description: 'User Guide: Install and Manage Spinnaker on Google Cloud Platform'
      url: https://cloud.google.com/docs/ci-cd/spinnaker/spinnaker-for-gcp
    - description: 'Spinnaker Documentation'
      url: https://spinnaker.io
